package net.ccbluex.liquidbounce.ui.client.clickgui.neverlose.implvalueimport me.aquavit.liquidsense.event.Listenableimport net.ccbluex.liquidbounce.value.FloatValueimport net.ccbluex.liquidbounce.value.IntegerValueimport net.ccbluex.liquidbounce.value.Valueobject Editbox {    //可以输入的值    var value : Value<*> ?= null    var newvalue : String ?= null    fun set(value : Value<*> , newValue : String)  {        if(value is FloatValue) {            println(newvalue!!.toFloat())            value.set(newValue.toFloat())        }        if(value is IntegerValue) {            println(newvalue!!.toInt())            value.set(newValue.toInt())        }    }}